import React from 'react';
import '../assets/styles/App.css';
import { Player } from '@lottiefiles/react-lottie-player';
import '../assets/styles/Nav.css';
import atom from '../assets/imgs/atom.json';

const Home = () => {
  return (
    <div>
      <div>
        Hello Home
      </div>
      <button className="home__icon" onClick={handleHomeClick}>
        <Player
          autoplay
          loop
          src={atom}
          className='atom'
        />
      </button>
    </div>

  );
};

export default Home;
